import {$authHost, $host} from "./index";



export const fetchCabinet = async () => {
    const {data} = await $host.get('api/cabinet/')
    return data
}

export const fetchOneCabinet = async (id) => {
    const {data} = await $host.get('api/cabinet/'+ id)
    return data
}
